function nameValidation(name, errorArray) {
    //var regName = /^[a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ°]+ [a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ°]+$/;
    //var regName = /^[a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ°]+(([',. -][a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ° ])?[a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ°]*)*$/;

    //var regName = /^\s*([A-Za-z]{1,}([\.,] |[-']| ))+[A-Za-z]+\.?\s*$/;
    if (name == "" || name == null || name == undefined) {
        errorArray.push(localR.GetValueFromLangKeyList("Error_Form_Empty_Field"));
        return;
    }


    var regName = /^[a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ°]+(([',. -][a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ° ])?[a-zÄ±ÄÃ¼ÅÃ¶Ã§A-ZÄÃÅÃÃÄ°]*)*$/
    var haveWhiteSpaceReg = !new RegExp('^\\S+$').test(name);

    if (!haveWhiteSpaceReg) {
        errorArray.push(localR.GetValueFromLangKeyList("Error_Form_Invalid_FullName"));
        return false;
    }
    if (!regName.test(name)) {

        errorArray.push(localR.GetValueFromLangKeyList("Error_Form_Invalid_FullName"));
        //errorArray.push("name err");

        //errorArray.push('Please enter your full name (first & last name).');
        return false;
    } else {

        return true;
    }
}
function validateEmail(email, errorArray) {
    //if (email == "" || email == null || email == undefined) {
    //  let errorText = new LocalrProvider().GetValueFromLangKeyList("Error_Form_Empty_Field") || "Email error";
    //  errorArray.push(errorText);
    //  return;
    //}

    const re = /^(?=.{6,254}$)(?:[a-z0-9!#$%&'*+/=?^_`{|}~-]+(?:\.[a-z0-9!#$%&'*+/=?^_`{|}~-]+)*|"(?:[\x01-\x08\x0b\x0c\x0e-\x1f\x21\x23-\x5b\x5d-\x7f]|\\[\x01-\x09\x0b\x0c\x0e-\x7f])*")@(?:(?:[a-z0-9](?:[a-z0-9-]*[a-z0-9])?\.)+[a-z0-9](?:[a-z0-9-]*[a-z0-9])?|\[(?:(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\.){3}(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?|[a-z0-9-]*[a-z0-9]:(?:[\x01-\x08\x0b\x0c\x0e-\x1f\x21-\x5a\x53-\x7f]|\\[\x01-\x09\x0b\x0c\x0e-\x7f])+)\])/g;

    if (!re.test(email)) {
        let errorText = localR.GetValueFromLangKeyList("Error_Form_Invalid_Email") || "Email error";

        errorArray.push(errorText);
        return false;
    }
    else {

        return true;
    }
}

