function validateDate(value, errorArray) {
    var errMsg = "";
    var expire = value; // 6/22
    if (!expire.match(/(0[1-9]|1[0-2])\/[0-9]{2}/)) {
        errMsg += localR.GetValueFromLangKeyList("Error_Form_Invalid_ExpireDate");
        errorArray.push(errMsg)
        result = false;
    } else {

        // get current year and month
        var d = new Date();
        var currentYear = d.getFullYear();
        var currentMonth = d.getMonth() + 1;
        // get parts of the expiration date
        var parts = expire.split('/');
        var year = parseInt(parts[1], 10) + 2000;
        var month = parseInt(parts[0], 10);
        // compare the dates
        if (year < currentYear || (year == currentYear && month < currentMonth)) {
            errMsg += localR.GetValueFromLangKeyList("Error_Form_Invalid_ExpireDate");
            errorArray.push(errMsg)
            result = false;
        }

    }

    return result;
}


function validateCVV(creditCardName, cvv, errorArray) {
    if ("-" == creditCardName || "" == creditCardName) {
        errorArray.push(localR.GetValueFromLangKeyList("Error_Form_Invalid_CVV"))
        return false;
    }


    var cvv = cvv.replace(/\D/g, '');
    // american express and cvv is 4 digits
    if (creditCardName == "amex") {
        if ((/^\d{4}$/).test(cvv))
            return true;
    } else if ((/^\d{3}$/).test(cvv)) { // other card & cvv is 3 digits
        return true;
    }

    errorArray.push(localR.GetValueFromLangKeyList("Error_Form_Invalid_CVV"))
    return false;


}

//luhn
function valid_credit_card(value) {
    // Accept only digits, dashes or spaces
    if (/[^0-9-\s]+/.test(value)) return false;

    // The Luhn Algorithm. It's so pretty.
    let nCheck = 0, bEven = false;
    value = value.replace(/\D/g, "");

    for (var nc = value.length - 1; nc >= 0; nc--) {
        var cDigit = value.charAt(nc),
            nDigit = parseInt(cDigit, 10);

        if (bEven && (nDigit *= 2) > 9) nDigit -= 9;

        nCheck += nDigit;
        bEven = !bEven;
    }

    return (nCheck % 10) == 0;
}


function passwordToggle(toggleElemClass) {

    $(document).ready(function () {
        toggleElemClass = toggleElemClass == undefined ? $(".toggle-password") : toggleElemClass;
        toggleElemClass.click(function () {
            $(this).toggleClass("pass-close");
            var input = $($(this).attr("toggle"));
            if (input.attr("type") == "password") {

                input.attr("type", "text");
            } else {
                input.attr("type", "password");
            }
        });
    });


}


